import {
  IonContent,
  IonIcon,
  IonItem,
  IonLabel,
  IonList,
  IonListHeader,
  IonMenu,
  IonMenuToggle,
  IonNote,
} from "@ionic/react";

import { useLocation } from "react-router-dom";
import {
  businessOutline,
  businessSharp,
  gridOutline,
  gridSharp,
  home,
  homeOutline,
  mailOutline,
  mailSharp,
  peopleOutline,
  peopleSharp,
  personOutline,
  personSharp,
  starOutline,
  starSharp,
} from "ionicons/icons";
import "./Menu.css";

interface AppPage {
  url: string;
  iosIcon: string;
  mdIcon: string;
  title: string;
}
interface Admin {
  name: string;
  surname: string;
}

const admin: Admin = {
  name: "Vishen",
  surname: "Mahabeer",
}

const appPages: AppPage[] = [
  {
    title: "Dashboard",
    url: "/page/dashboard",
    iosIcon: homeOutline,
    mdIcon: home,
  },
  {
    title: "Calendar",
    url: "/page/calendar",
    iosIcon: mailOutline,
    mdIcon: mailSharp,
  },
  {
    title: "Agent Management",
    url: "/page/agent",
    iosIcon: peopleOutline,
    mdIcon: peopleSharp,
  },
  {
    title: "Complex Management",
    url: "/page/complex",
    iosIcon: businessOutline,
    mdIcon: businessSharp,
  },
  {
    title: "Package Management",
    url: "/page/package",
    iosIcon: gridOutline,
    mdIcon: gridSharp,
  },
  {
    title: "Promotion Management",
    url: "/page/promotion",
    iosIcon: starOutline,
    mdIcon: starSharp,
  },
  {
    title: "Profile",
    url: "/page/profile",
    iosIcon: personOutline,
    mdIcon: personSharp,
  },
];

const labels = ["Family", "Friends", "Notes", "Work", "Travel", "Reminders"];

const Menu: React.FC = () => {
  const location = useLocation();

  return (
    <IonMenu contentId="main" type="overlay">
      <IonContent>
        <IonList id="inbox-list">
          <IonListHeader>The Green Wash Admin</IonListHeader>
          <IonNote>{admin.name} {admin.surname}</IonNote>
          {appPages.map((appPage, index) => {
            return (
              <IonMenuToggle key={index} autoHide={false}>
                <IonItem
                  className={
                    location.pathname === appPage.url ? "selected" : ""
                  }
                  routerLink={appPage.url}
                  routerDirection="none"
                  lines="none"
                  detail={false}
                >
                  <IonIcon
                    slot="start"
                    ios={appPage.iosIcon}
                    md={appPage.mdIcon}
                  />
                  <IonLabel>{appPage.title}</IonLabel>
                </IonItem>
              </IonMenuToggle>
            );
          })}
        </IonList>
      </IonContent>
    </IonMenu>
  );
};

export default Menu;
